pragma solidity ^0.6.12;

contract CustomSortedLinkedList {

    struct Item {
        uint score;
        address next;
    }

    mapping(address => Item) public items;

    struct ArrayItem {
        address current;
        uint score;
        uint next;
    }

    ArrayItem[13] itemsArray;

    address constant public GUARD = address(0);

    function addItem(address user, uint score, address prev) public {
        require(_verify(score, prev));
        Item memory item;
        item.score = score;
        item.next = items[prev].next;
        items[user] = item;
        items[prev].next = user;
    }

    function addArrayItem(address user, uint score, uint prev) public {
        ArrayItem memory item;
        item.score = score;
        item.next = itemsArray[prev].next;
        item.current = user;

        itemsArray[itemsArray.length] = item;

        itemsArray[prev].next = itemsArray.length;
    }

//    function getArrayList() public view returns (uint[] memory) {
//
//    }

    function _verify(uint score, address prev) internal view returns (bool) {
        return prev == GUARD ||
        (score <= items[prev].score && score > items[items[prev].next].score);
    }

    function getList(uint k) public view returns (uint[] memory) {
        uint[] memory list = new uint[](k);
        Item memory currItem = items[GUARD];
        uint i = 0;
        while (currItem.next != GUARD && i < k) {
            list[i] = currItem.score;
            currItem = items[currItem.next];
            i++;
        }
        return list;
    }
}
